    constructor(props) {
        super(props);
        this.state = {
            country: [] 
        };
    }

    componentDidMount() {
        console.log("Hello world");
        axios.get('http://localhost:8080/covid-api/in').then((data)=>{
            console.log(data)
        }).catch((err)=>{
            console.log(err);
        })
        // CovidTrackerService.getData().then((response) => {
