                <table>
                    <thead>
                        <tr>
                            <td> Name</td>
                            <td> Code</td>
                            <td> Population </td>
                            <td> Latest Data </td>
                            <td> Timeline </td>
                        </tr>
                    </thead>
                    {/* <tbody>
                        {
                            this.state.country.map(c=>
                                <tr key = {c.code}>
                                    <td>{c.name}</td>
                                    <td>{c.code}</td>
                                    <td>{c.population}</td>
                                    <td>{c.latest_data}</td>
                                    <td>{c.timeline}</td>
                                </tr>
                            )
                        }
                        
                    </tbody> */}
                </table>
            </div>
        )
    }
}

export default CovidTrackerComponent;
